import React from 'react';
import { 
    ModalCard
  } from '@vkontakte/vkui';
import Icon28FavoriteCircleFillYellow from '@vkontakte/icons/dist/28/favorite_circle_fill_yellow';


export default class Donut extends React.Component {
    render() {
        return (
            <ModalCard
                id={this.props.id}
                onClose={this.props.onClose}
                icon={<Icon28FavoriteCircleFillYellow width={72} height={72} />}
                caption="Donut — отметка выдаваемая Агентам за поддержку проекта.
                        Агенты которые поддержали проект,
                        получают отметку на весь переод подписки . По
                        истечению данного периода, отметка пропадает"
                actions={[{
                  title: 'Понятно',
                  mode: 'secondary',
                  action: this.props.action
                }
                ]}
                
              />
        )
    }
}
